    const [isToggleOn, setToggle] = useState(true)

   const hanClick = () => {
        setToggle( isToggleOn  ? false : true)
      }

return (

<div className="App">

<button onClick={hanClick}>
            {isToggleOn ? 'ON' : 'OFF'}
          </button>
<Trading/>
{/* <TradingTwo/> */}



</div>

);
}

export default App;
